/* eslint-disable import/no-anonymous-default-export */


import Card from "../Carroussel/Card/Card";
import Card01 from "../Carroussel/Card01/Card01";
import img01 from "../../../../src/Foto/img/Dubai1.jpg";
import img02 from "../../../../src/Foto/img/Madri.jpg";
import img03 from "../../../../src/Foto/img/caribeHolandes.jpg";
import img04 from "../../../../src/Foto/img/disnei.png";
import img05 from "../../../../src/Foto/img/betoCarreiro.jpg";


export default() => { 
    return(


  <div className="row row-cols-1 row-cols-md-3 g-4">
  
      <Card Foto={img01} alt="..."></Card>
      <Card Foto={img02} alt="..."></Card>
      <Card Foto={img03} alt="..."></Card>
      <Card Foto={img04} alt="..."></Card>
      <Card Foto={img05} alt="..."></Card>

    
</div>

);
}
